// GetAllCompanys.tsx

import { Company } from '../../../Entitis.type';
import { useState, useEffect } from 'react';
import '../../../Design/GetAllCompanys.css';
import { Link, useNavigate } from 'react-router-dom';

type Props = {
  token: string
};

const GetAllCompanys = (props: Props) => {
  const navigate = useNavigate();
  const [company, setCompany] = useState<Array<Company>>([]);
  console.log(props.token);

  useEffect(() => {
    fetch('http://localhost:8080/admin/company/all', {
      method: 'GET',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    })
      .then((res) => res.json())
      .then((data) => {
        setCompany(data)
        console.log(data); // log response data to console
      })
      .catch((error) => console.log(error));
  }, []); // add empty array to run useEffect only once on component mount

  return (
    <div className="getAllCompanys">
      <button onClick={() => navigate(-1)}>Back</button>
      <table>
        <thead>
          <tr>
          <th>Id:</th>
            <th>Company Name:</th>
            <th>Category:</th>
            <th>Price:</th>
          </tr>
        </thead>
        <tbody>
          {company.map((companys) => {
            return (
              <tr key={companys.id}>
                <td className='id'>{companys.id} </td>
                <td>
                  <Link to={`/getOneCompany/${companys.id}`}>
                  <div className="company-name">
                    {companys.name}
                    </div>
                  </Link>
                </td>
                <td>
                  {companys.coupons.map((coupons) => {
                    return (
                      <div key={coupons.id}>
                        {coupons.category && <div>{coupons.category}</div>}
                      </div>
                    );
                  })}
                </td>
                <td>
                  {companys.coupons.map((coupons) => {
                    return (
                      <div key={coupons.id}>
                        {coupons.price && <div>{coupons.price}</div>}
                      </div>
                    );
                  })}
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
      <div className="add">
        <Link to='/addCompany'className='professional-button'>Add Company</Link>   
      </div>
    </div>
  );
};

export default GetAllCompanys;
